●三次元クロスリンクメッシュでワイドに拡散、効力アップ！<br>※風向きや設置場所により虫よけ効果が異なります。<br>効果が見られない時は設置場所を変えるか、害虫が大量に飛来する場合は殺虫エアゾールと併用してください。<br>●フックは縦横調整自在です。<br>●シックなカラーで玄関につっても目立たず違和感なく使用できます。<br><br>【使用上の注意】<br>●プラスチック容器の中のメッシュを取り出さないでください。<br>●万一、身体に異常を感じた場合は、本品がピレスロイド系の薬剤であることを医師に告げて、診療を受けてください。<br>●使用方法を守って、定められた用途以外には使用しないでください。<br>●直接プラスチック容器の中のメッシュに手を触れないでください。誤って触れた場合は石けんでよく洗ってください。<br>●小児やペットがもてあそばない所で使用してください。<br>●火気の付近では使用しないでください。<br>●アレルギー体質の人は使用に注意してください。<br>●狭い場所で使用する場合は、できるだけ密閉状態を避け、時々換気をしてください。<br>●観賞魚等のいる水槽に、本品が入らないようにしてください。<br>●殺虫剤とは異なりますので、害虫が大量に発生し、次々に飛来する場合など、速効性を期待される場合は、殺虫エアゾールと併用してください。<br>●強風時など本品が激しく揺れると、ドアを傷つける恐れがありますので、その際は一旦本品を外してください。<br>●直射日光を避け、小児の手の届かない涼しいところに保管してください。<br>●高温になるところ(車内、電気製品付近など)で長時間の保管は避けてください。<br>●一旦使用を中断される場合は、元の袋に戻し、テープ等で必ず密封してください。<br>●廃棄については自治体の指導に従って捨ててください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：大日本除虫菊(金鳥)<br>シリーズ名：虫コナーズ<br>内容量：1個<br>適用害虫：ユスリカ、チョウバエ<br>有効成分：ピレスロイド系薬剤<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/gentei.jpg alt=数量限定><br><font color=#FF0000>※数量限定のため、先着順での販売となります。<br>　ご注文のタイミングによっては、完売となっている場合がございます。<br>　その際はキャンセル扱いとさせていただきますので、予めご了承下さい。</font><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4987115544635 FM9258 fm9258 大日本除虫菊 だいにほんじょちゅうぎく だいにっぽんじょちゅうぎく 大日本除虫菊株式会社 金鳥 きんちょう きんちょー キンチョウ キンチョー KINCHO kincho Kincho 虫コナーズ むしこなーず ムシコナーズ 虫除け 虫除け むしよけ ムシヨケ 置き型 おきがた つるす 吊るす 蚊 か カ 玄関 げんかん ゲンカン ユスリカ チョウバエ ゆすりか ちょうばえ ハエ はえ ピレスロイド系薬剤 ぴれすろいどけいやくざい ピレスロイドケイヤクザイ ピレスロイド ぴれすろいど 無臭 むしゅう 無香 むこう</font></td></tr></table><style type="text/css">
